import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

import ItemCard from './ItemCard';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    margin: 50
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    padding: 100,
    margin: 10,
  },
}));

export default function MatketItems() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item md={4} sm={12}>
          <ItemCard image={'https://media3.tchibo-content.de/newmedia/art_img/MAIN_HD/ff16971b15e86f24/barista-espresso-500g-cekirdek-kahve.jpg'}
                    name={'Barista Espresso Çekirdek Kahve 500g'}
                    description={'Bitter Aromalı & Yumuşak Gövdeli'}
                    price={'64,95 TL'}/>
        </Grid>
        <Grid item md={4} sm={12}>
          <Paper className={classes.paper}>Ürün 2</Paper>
        </Grid>
        <Grid item md={4} sm={12}>
          <Paper className={classes.paper}>Ürün 3</Paper>
        </Grid>
      </Grid>
      <Grid container spacing={3}>
        <Grid item md={4} sm={12}>
          <Paper className={classes.paper}>Ürün 4</Paper>
        </Grid>
        <Grid item md={4} sm={12}>
          <Paper className={classes.paper}>Ürün 5</Paper>
        </Grid>
        <Grid item md={4} sm={12}>
          <Paper className={classes.paper}>Ürün 6</Paper>
        </Grid>
      </Grid>
    </div>
  );
}
